import React from "react";
import ReactDelayRender from "react-delay-render";
import FadeIn from "react-fade-in";

import "./AboutMe.css";

const AboutMe = () => {
  return (
    <FadeIn>
      <div className="about__wrapper">
        <p className="about__paragraph">Hi, thank you for visiting my page!</p>
        <p className="about__paragraph">
          My name is Filip. I am a Polish guy currently residing in Cork,
          Ireland.
        </p>
        <p className="about__paragraph">
          This simple page is just a repository for all of my projects from the
          beginning of my coding journey, I am aspiring to become a Front End
          Developer so I simply wanted to have something more personal than a
          GitHub account ðŸ˜Š
        </p>
      </div>
    </FadeIn>
  );
};

export default ReactDelayRender({ delay: 401 })(AboutMe);
